import Content from"../components/list_projects_page/Content";
import Footer from "../components/list_projects_page/Footer";
import Header from "../components/list_projects_page/Header";


import styled from 'styled-components';

import { GlobalStyle } from '../components/list_projects_page/styles';



const Warpper = styled.div`

 font-family: 'Roboto', sans-serif;
 display:flex;
 height:100vh;
 flex-direction: column;
 justify-content: space-between;
 h1{
     padding-left:30px;
     color:#005151;
 }

`

function App(){
    return (
        <>
        <GlobalStyle/>
        <Warpper>
            <Header/>
            <h1>Projetos e Pesquisas</h1>
            <Content/>
            <Footer/>
        </Warpper>
    </>
    )
}

export default App
